(98, 'صحيفة عكاظ صحيفة سعودية تصدر باللغة العربية عن مؤسسة عكاظ للصحافة والنشر منذ عام 1958. اختير اسم عكاظ لأنه يحمل اسم سوق عكاظ وهو من أسواق العرب في الجاهلية بالطائف. صدر العدد الأول من عكاظ في يوم السبت 3 ذي الحجة 1379هـ الموافق 28 مايو 1960م، في مدينة الطائف. ويكيبيديا\r\n\r\nجريدة الرياض، هي صحيفة يومية عربية سعودية تصدر عن مؤسسة اليمامة الصحفية، ويرأس تحريرها الأستاذ فهد بن راشد العبد الكريم اعتباراً من الأول من أغسطس عام 2015. ويكيبيديا\r\n\r\nجريدة الوطن هي صحيفة سعودية ذات توجه ثقافي اصلاحي تصدر عن مؤسسة عسير للصحافة والنشر في منطقة عسير في السعودية في مدينة أبها، تم تكليف سليمان العقيلي رئيسا مكلفا للتحرير بعد إقالة جمال أحمد خاشقجي، يرأس تحريرها حالياً الدكتور عثمان الصيني بدأت النشر في عام 2000. سبق أن ترأس تحريرها قينان الغامدي. ويكيبيديا', NULL, NULL, 0, 0, 0, 123, 'questions/UPeCNAoF3NPxAZnHzTqoZFQaVaHycGOkevf9WYYL.mp4', NULL, '2018-11-20 14:08:17', '2018-11-20 14:08:17'),
(99, '(CNN)According to a recent paper, the Earth is caught directly in the crosshairs of a cosmic hurricane. A swarm of nearly 100 stars, accompanied by an even greater amount of dark matter, is aimed directly at our stellar neighborhood and there\'s nothing we can do to stop it; in fact, the vanguard is already upon us. This sounds like a perfect summer blockbuster movie, starring The Rock and Chris Pratt, or maybe Scarlett Johansson and Charlize Theron.\r\n\r\nDon Lincoln\r\nExcept this is for real. But is it a danger? Well, actually, no. Not at all. But it\'s potentially incredibly fascinating, with lots of interesting scientific interconnections. So, what is really going on?\r\n\r\nThe story starts last April, when the Gaia satellite announced the locations and trajectories of 2 billion stars in the vicinity of the Milky Way surrounding our sun. They released the data to the public.', NULL, NULL, 0, 0, 0, 126, 'questions/y7BIO1yQs2ub354ZJpOQ9aoWBUBB8Imsbgg3JiUn.jpeg', NULL, '2018-11-20 14:18:52', '2018-11-20 14:18:52'),
(100, 's', NULL, 'بسيبسبيبيييبيبي', 0, 1, 0, 127, 'questions/rzOK4G3ZMLeNI85n1MmM28WPasjL7dXeMrVq92a5.png', NULL, '2018-11-20 14:21:37', '2018-11-26 13:49:24'),
(101, 'شهرت وزارة التجارة والاستثمار بشركة سيارات نظير مخالفتها لنظام الوكالات التجارية وأحكام الصيانة وتوفير قطع الغيار وضمان جودة الصنع، وذلك بعد صدور حكم قضائي بثبوت مخالفة الشركة لنظام الوكالات التجارية ولائحته التنفيذية حيث تمت إدانتها بالتأخر في توفير قطع الغيار المطلوبة لأحد المستهلكين مدة تزيد عن 30 يوماً، وبناء عليه صدر قرار هيئة تطبيق العقوبات المؤيد من المحكمة الإدارية بالرياض بمخالفة الشركة وفرض غرامة مالية قدرها خمسون ألف ريال ونشر الحكم في صحيفة محلية على نفقة المنشأة.\r\n----------------------\r\n123\r\n\r\nوتعود تفاصيل القضية لتقدم أحد المواطنين ببلاغ لوزارة التجارة والاستثمار ضد الشركة نتيجة عدم توفر قطع غيار لسيارته خلال المدة المحددة نظاماً والمقدرة بـ 14 يوماً.\r\n\r\n123\r\n--------\r\nووفقاً للمادة السادسة من أحكام الصيانة وتوفير قطع الغيار وضمان جودة الصنع المعدلة للمادة الثالثة للائحة التنفيذية لنظام الوكالات التجارية يلتزم الوكيل أن يوفر بصفة دائمة وبأسعار معقولة قطع الغيار التي يطلبها المستهلكين عادة بشكل مستمر، وإن كانت قطع الغيار نادرة الطلب وجب على الوكيل توفيرها بأسعار معقولة خلال مدة لا تزيد عن 14 يوماً من تاريخ طلب المستهلك لها إلا القطع التي تصنع خصيصاً للمستهلك أو ذات المواصفات الفنية الخاصة فعندئذ يتفق الوكيل مع المستهلك كتابة على مدة معقولة لتوفير قطع الغيار .\r\n\r\nتجدر الإشارة إلى أن الوزارة سبق أن شهرت بمخالفات عدد من الشركات والوكالات غير الملتزمة بتقديم خدمات ما بعد البيع للمستهلكين وطبقت العقوبات النظامية بحقها وذلك وفقاً للأنظمة، وذلك ضمن جهودها المستمرة لحماية المستهلكين وإيقاع العقوبات على المنشآت المخالفة لأحكام نظام الوكالات التجارية ولائحته التنفيذية.\r\n\r\nوتؤكد وزارة التجارة والاستثمار على ضرورة التزام وكالات وشركات السيارات بتأمين قطع الغيار وتقديم أعمال الصيانة للمستهلكين وفقاً للعقود المبرمة بين الطرفين.\r\n\r\nكما تشدد الوزارة على متابعة التزام الوكالات بتطبيق أحكام اللائحة التنفيذية لنظام الوكالات التجارية التي تهدف لتنظيم العلاقة بين الوكلاء والموزعين مع المستهلكين في المملكة بما ينسجم مع أحكام نظام الوكالات التجارية ويراعي ويحفظ حقوق كافة الأطراف.\r\n\r\nوتدعو الوزارة عموم المستهلكين إلى الإبلاغ عن شكاواهم لمركز البلاغات في الوزارة على الرقم 1900، أو عبر تطبيق \"بلاغ تجاري\"، أو الموقع الإلكتروني للوزارة على الإنترنت\r\n----------------------\r\nشهرت وزارة التجارة والاستثمار بشركة سيارات نظير مخالفتها لنظام الوكالات التجارية وأحكام الصيانة وتوفير قطع الغيار وضمان جودة الصنع، وذلك بعد صدور حكم قضائي بثبوت مخالفة الشركة لنظام الوكالات التجارية ولائحته التنفيذية حيث تمت إدانتها بالتأخر في توفير قطع الغيار المطلوبة لأحد المستهلكين مدة تزيد عن 30 يوماً، وبناء عليه صدر قرار هيئة تطبيق العقوبات المؤيد من المحكمة الإدارية بالرياض بمخالفة الشركة وفرض غرامة مالية قدرها خمسون ألف ريال ونشر الحكم في صحيفة محلية على نفقة المنشأة.\r\n\r\nوتعود تفاصيل القضية لتقدم أحد المواطنين ببلاغ لوزارة التجارة والاستثمار ضد الشركة نتيجة عدم توفر قطع غيار لسيارته خلال المدة المحددة نظاماً والمقدرة بـ 14 يوماً.\r\n\r\nووفقاً للمادة السادسة من أحكام الصيانة وتوفير قطع الغيار وضمان جودة الصنع المعدلة للمادة الثالثة للائحة التنفيذية لنظام الوكالات التجارية يلتزم الوكيل أن يوفر بصفة دائمة وبأسعار معقولة قطع الغيار التي يطلبها المستهلكين عادة بشكل مستمر، وإن كانت قطع الغيار نادرة الطلب وجب على الوكيل توفيرها بأسعار معقولة خلال مدة لا تزيد عن 14 يوماً من تاريخ طلب المستهلك لها إلا القطع التي تصنع خصيصاً للمستهلك أو ذات المواصفات الفنية الخاصة فعندئذ يتفق الوكيل مع المستهلك كتابة على مدة معقولة لتوفير قطع الغيار .\r\n\r\nتجدر الإشارة إلى أن الوزارة سبق أن شهرت بمخالفات عدد من الشركات والوكالات غير الملتزمة بتقديم خدمات ما بعد البيع للمستهلكين وطبقت العقوبات النظامية بحقها وذلك وفقاً للأنظمة، وذلك ضمن جهودها المستمرة لحماية المستهلكين وإيقاع العقوبات على المنشآت المخالفة لأحكام نظام الوكالات التجارية ولائحته التنفيذية.\r\n\r\nوتؤكد وزارة التجارة والاستثمار على ضرورة التزام وكالات وشركات السيارات بتأمين قطع الغيار وتقديم أعمال الصيانة للمستهلكين وفقاً للعقود المبرمة بين الطرفين.\r\n\r\nكما تشدد الوزارة على متابعة التزام الوكالات بتطبيق أحكام اللائحة التنفيذية لنظام الوكالات التجارية التي تهدف لتنظيم العلاقة بين الوكلاء والموزعين مع المستهلكين في المملكة بما ينسجم مع أحكام نظام الوكالات التجارية ويراعي ويحف