(136, 'كيف يتم رفع الموقع على السيرفر؟\r\n\r\nكثيراً مانصادف مُصطلح “سيرفر” او “خادم” او ما يُعرف بالإنجليزية بـ “Server” عندما نبحث فى الإنترنت عن استضافة المواقع، والسيرفر هو اساس استضافة المواقع على الشبكة العنكبوتية وجميع المواقع علي شبكة الإنترنت تعمل بواسطة سيرفرات.\r\n------------------------------------------------------------------------------\r\nالسيرفر او الخادم هو عبارة عن جهاز كمبيوتر ذو امكانيات عاليه. وأهم هذه الإمكانيات هو الإتصال بالإنترنت بسرعة فائقة ومصدر كهرباء مستمر. \r\n\r\n- ويحتاج ايضاً الى انظمة تبريد عالية لانه سوف يعمل 24 ساعة يومياً طوال ايام السنة.', NULL, 'لكي اوضح لك كيفية عمل السيرفر فسوف اشرح لك ما يحدث عندما تزور موقع انترنت لكن من جانب السيرفر..\r\n\r\n\r\nانت تضع رابط الموقع فى المتصفح وتضغط زر إدخال “Enter”.\r\n\r\nالمتصفح يتصل بخادم الدى ان اس DNS.\r\n\r\nخادم الدي ان اس يُرسل للمتصفح الآي بي IP الخاص بالسيرفر المُستضاف عليه دومين الموقع.\r\nالمتصفح يقوم بالإتصال بالسيرفر المُستضاف عليه الموقع ويطلب منه الصفحة التى قمت أنت بإضافة الرابط الخاص بها.\r\n\r\nالخادم يقوم بتجهيز الصفحة وإرسالها للمتصفح فى صورة حزم بيانات.\r\n\r\nالمُتصفح يقوم بعرض الصفحة التى تم ارسالها اليه من قبل الخادم للمُستخدم (أنت).\r\nبالطبع هذه العمليه تتم بسرعة جداً ووفقا لإمكانيات الخادم وسرعة اتصال كلاً من الخادم والمُستخدم بالإنترنت والأهم هو الخادم لأنه قد يتعامل مع الآلاف من المُستخدمين فى نفس اللحظه.', 0, 5, 0, 183, NULL, NULL, '2018-11-25 12:31:17', '2018-12-02 18:27:59'),
(137, 'لسلام عليكم ي اخوان\r\n\r\n\r\nعندي 2 سؤال اتمني تجاوبوني عليهم\r\n\r\n\r\nالسؤال الاول\r\n\r\n\r\nعملت موقع علي السيرفر المحلي وهو شغال تماما\r\n\r\n\r\nكيف ارفع االموقع علي الانترنت او الدومين الخاص بي ؟؟؟\r\n\r\n------------------------\r\n\r\nاتمني من اصحاب الاختصاص الاجابة بشئ من التفصيل', NULL, 'و عليك السلام والرحمة\r\n\r\n\r\nبالنسبة للسؤال الاول بتستخدم بيانات السيرفر اسم المستخدم و الباسورد في اي برنامج يستخدم لرفع المواقع - فابل زيلا- لو الموقع مطورو بي php او ممكن تخش نافذة الادمن وبكون فب خاصية لافع الملفات\r\n\r\n\r\nاما لو مطور asp.net بترفع التطبيق من visual stdio ....\r\n\r\n\r\nبالنسبة للسؤال التاني\r\nقاعدة البيانات حتفتحها في السيرفر بعد داك نقذ الاسكريبت\r\n\r\n---------------------\r\n	\r\nAhmed Nasr2\r\nAhmed Nasr2\r\nنشر الثلاثاء في 18:11\r\nفي اكثر من طريقه لرفع الموقع على ال host \r\n\r\nأولا في database بتعمل generate script  وبتروح في الهوست تعمل run for the script  \r\n\r\nثانيا بتعمل تعديل لما ال database يعني انك بتعدل مكان الdatabase انه على الserver مش على ال local host \r\n\r\nثالثا بتضغط ملفات الموقع وترفعها على الهوست  وتفك الضغط الهوست \r\n\r\nوبكده يكون الموقع اترفع ويشتغل على اللىنك الخاص بيك', 0, 5, 0, 184, NULL, NULL, '2018-11-25 13:14:56', '2018-12-02 18:28:12'),
