(143, 'كما ذكرنا سابقاً، فإن الخادم او السيرفر يكون عباره عن جهاز كمبيوتر بمواصفات خاصة ولكن ليس من الضرورى أن يكون كذلك، حيث أن أى جهاز كمبيوتر عادي يُمكن تحويله لخادم إنترنت. ويتم ذلك عن طريق تثبيت نظام تشغيل عليه وربطه بالإنترنت وبمصدر تيار كهربائي بإستمرار.\r\n\r\n\r\nلكن شركات صناعة الكمبيوتر مثل Dell و HP تقوم بإنتاج أجهزة كمبيوتر تشبة الأجهزة العادية بشكل كبير لكن تمتاز عنها بأنها تستطيع العمل بإستمرار بدون إرتفاع درجة الحرارة وذلك عن طريق دمج Power Supply ذو إمكانيات خاصة. وتختلف امكانيات السيرفر من اصدار لآخر ومن جهاز لآخر. \r\n\r\nوطبعاً يجب ان يكون السيرفر مُتصل طوال الوقت بمصدر تيار كهربائي وبالإنترنت. ووجود مجموعة من الخوادم مع بعضها البعض في مكان واحد يُكَوّنْ ما يُعرف بمركز البيانات او الداتا سنتر Data Center.\r\n\r\nفيما يستخدم الخادم؟', NULL, 'في اكثر من طريقه لرفع الموقع على ال host \r\n\r\nأولا في database بتعمل generate script  وبتروح في الهوست تعمل run for the script  \r\n\r\nثانيا بتعمل تعديل لما ال database يعني انك بتعدل مكان الdatabase انه على الserver مش على ال local host \r\n\r\nثالثا بتضغط ملفات الموقع وترفعها على الهوست  وتفك الضغط الهوست \r\n\r\nوبكده يكون الموقع اترفع ويشتغل على اللىنك الخاص بيك', 0, 3, 0, 191, NULL, NULL, '2018-11-29 17:17:45', '2018-11-30 15:36:19'),
