(154, 'اختيار أفضل شركة استضافة لموقعك يجب أن يكون علي قمة هرم أولوياتك، لأن اختيار استضافة جيدة يُريحك من الكثير من المشكلات بعد ذلك. عميد الاستضافة ينشر مميزات وعيوب شركات استضافة المواقع مع شرح شراء استضافة واستخدامها إضافةً إلي خصومات حصرية وكوبونات شركات استضافة مواقع الإنترنت أضف إلي ذلك سلسلة من الدروس والشروحات و كل ما يتعلق بمجال استضافة المواقع.', NULL, 'الإجابة الأولى:\r\n---------------------------\r\nالسيرفر او الخادم هو عبارة عن جهاز كمبيوتر ذو امكانيات عاليه. وأهم هذه الإمكانيات هو الإتصال بالإنترنت بسرعة فائقة ومصدر كهرباء مستمر. ويحتاج ايضاً الى انظمة تبريد عالية لانه سوف يعمل 24 ساعة يومياً طوال ايام السنة.\r\n\r\nالسيرفر او الخادم هو عبارة عن جهاز كمبيوتر ذو امكانيات عاليه. وأهم هذه الإمكانيات هو الإتصال بالإنترنت بسرعة فائقة ومصدر كهرباء مستمر. ويحتاج ايضاً الى انظمة تبريد عالية لانه سوف يعمل 24 ساعة يومياً طوال ايام السنة.\r\n\r\n\r\nالسيرفر او الخادم هو عبارة عن جهاز كمبيوتر ذو امكانيات عاليه. وأهم هذه الإمكانيات هو الإتصال بالإنترنت بسرعة فائقة ومصدر كهرباء مستمر. ويحتاج ايضاً الى انظمة تبريد عالية لانه سوف يعمل 24 ساعة يومياً طوال ايام السنة.', 0, 8, 0, 200, NULL, NULL, '2018-12-02 11:08:22', '2018-12-11 16:18:57'),
