(32, 'PHP for web', 'learn for the future', 'php-for-web', 'Learn PHP programming the quick and easy way! \r\nWith PHP for the Web: Visual QuickStart Guide readers can start from the beginning to get a tour of the programming language, or look up specific tasks to learn just what they need to know. \r\nThis task-based visual reference guide uses step-by-step instructions and plenty of screenshots to teach beginning and intermediate users this popular open-source scripting language. Author Larry Ullman guides readers through the ins and outs of both PHP 5 and PHP 7, and offers more efficient ways to tackle common needs.', 'Lury King', '1234567', 'books/r0mWfwQnzl4jo8luszswIDawTu0FXKuphhUAMDsY.jpeg', 'books/nlEtVAK9E6sS2pvo77jCsXombMgCcE5aeA9GEd90.pdf', 'books/VvsvNPu5on38lLTZgKLXrYfuN6FDWhZAVRsuaNOJ.pdf', '3', 'الانجليزية', 'الرابع', 999, 330, 'العربية', '2222-02-22', 1, 1, '2018-04-05 15:07:07', '2018-06-11 08:53:21', NULL),
(33, 'Learning PHP', 'A Gentle Introduction to the Web\'s Most Popular Language', 'learning-php', 'If you want to get started with PHP, this book is essential. Author David Sklar (PHP Cookbook) guides you through aspects of the language you need to build dynamic server-side websites. By exploring features of PHP 5.x and the exciting enhancements in the latest release, PHP 7, you\'ll learn how to work with web servers, browsers, databases, and web services. End-of-chapter exercises help you make the lessons stick. Whether you\'re a hobbyist looking to build dynamic websites, a frontend developer ready to add server-side programs, or an experienced programmer who wants to get up to speed with this language, this gentle introduction also covers aspects of modern PHP, such as internationalization, using PHP from the command line, and package management. Learn how PHP interacts with browsers and servers Understand data types, variables, logic, looping, and other language basics Explore how to use arrays, functions, and objects Build and validate web forms Work with databases and session management Access APIs to interact with web services and other websites Jumpstart your project with popular PHP web application frameworks', 'David Sklar', '1234321234', 'books/PmMbNKBbZIpyEhp0yFGcbCtEBayczvf3z0ixZ1xv.jpeg', 'books/sTMJnZNuwxHOlWT0BNU0c7qyWX789MHAuGYRVbUo.pdf', 'books/ytd24vVFkHjgr2W9aLK12jpzQwMbyBK4CHiBaxMF.pdf', '4', 'english', 'الاصدار الخامس', 323, 899, 'ؤبسيبسبسيب', '1900-11-03', 1, 1, '2018-04-05 15:11:26', '2018-06-19 12:00:36', NULL),
(34, 'Database Systems', 'Design, Implementation, & Management', 'database-systems', 'Practical and easy to understand, DATABASE SYSTEMS: DESIGN, IMPLEMENTATION, AND MANAGEMENT, Eleventh Edition, gives students a solid foundation in database design and implementation. Filled with visual aids such as diagrams, illustrations, and tables, this market-leading text provides in-depth coverage of database design, demonstrating that the key to successful database implementation is in proper design of databases to fit within a larger strategic view of the data environment. Renowned for its clear, straightforward writing style, this text provides students with an outstanding balance of theory and practice. The eleventh edition has been updated to include expanded relational algebra coverage, updated business vignettes showing the impact of database tech in the real world, updated coverage of cloud data services, expanded coverage of Big Data and related Hadoop technologies, SQL coverage expanded to include MySQL databases, and many other improvements! In addition, new review questions, problem sets, and cases have been added throughout the book so that students have multiple opportunities to test their understanding and develop real and useful design skills.', 'Carlos Coronel Steven Morris', '1285196147', 'books/7sslXANI2AQLMQGvrcqUrjMSOKFNgu8pMLWd2rnv.jpeg', 'books/Ut3L8QLRJTale7M4tB9fuWfBtv6NMqajz7V8jNY3.pdf', 'books/QYrPMp5My7qJI4kIzMvXn6kEMyfZXjqn4hoY9JvT.pdf', '3', 'انجليزي', 'السادس', 896, 906, 'ييببيب يبليب يسريس', '2008-03-05', 0, 1, '2018-04-05 15:15:22', '2018-06-19 11:55:22', NULL),
(35, 'Algorithms', 'Algorithms', 'algorithms', 'Filling the void left by other algorithms books, Algorithms and Data Structures provides an approach that emphasizes design techniques. The volume includes application of algorithms, examples, end-of-section exercises, end-of-chapter exercises, hints and solutions to selected exercises, figures and notes to help the reader master the design and analysis of algorithms. This volume covers data structures, searching techniques, divided-and-conquer sorting and selection, greedy algorithms, dynamic programming, text searching, computational algebra, P and NP and parallel algorithms. For those interested in a better understanding of algorithms.', 'Richard Johnsonbaugh Marcus Schaefer', '0023606924', 'books/2RGDbakwkJrggxfZAEHmhQkCAg4bo2I8tzJnCNHr.jpeg', 'books/mWt4mK4M9DrPBG4pEjKw4NIzuVu4JFirS4MtW0Ic.pdf', 'books/hp6XY39PY5pcpSKPdTdjDhHk5PkpKuas8sf2IK42.pdf', '0', 'english', 'السابع', 886, 88, '545لا افاا لابي', '2222-03-31', 0, 1, '2018-04-05 15:20:42', '2018-06-13 08:47:52', NULL),
(36, 'الرياضيات في الأعمال', 'Practical Business Math Procedures', 'alryadyat-fy-alaaamal', 'The Twelfth Edition of Practical Business Math Procedures provides students with an engaging and personalized way to learn, therefore leading to success in the classroom and beyond. Respected authors, Jeffrey Slater and Sharon Wittry, incorporate examples from the Wall Street Journal and Kiplinger throughout the entirety of the text to reinforce real-world application of business math. Every chapter concludes with the Surf to Save exercises, which encourage students to apply the chapter material to their own lives while utilizing the InternetÃ¢â‚¬â„¢s abundant resources.Connect is the only integrated learning system that empowers students by continuously adapting to deliver precisely what they need, when they need it, and how they need it, so that your class time is more engaging and effective.\r\n\r\nSample questions asked in the 12th edition of Practical Business Math Procedures:\r\n\r\nLai Xiaodong, a 22-year-old college-educated man, accepted a job at Foxconn Technology (where the iPad was being produced for Apple) in Chengdu, China, for $22 a day at 12 hours a day, 6 days a week. A company perk included company housing in dorms for the 70,000 employees. It was common for 20 people to be assigned to the same three-bedroom apartment. What were Lai’s hourly (rounded to the nearest cent), weekly, and annual gross pay?\r\n\r\nJoe Madruga, of Madruga’s Taxi Service, received a bank statement for the month of May showing a balance of $932.36. His records show that the bank had not yet recorded two of his deposits, one for $521.50 and the other for $98.46. There are outstanding checks in the amounts of $41.67, $135.18, and $25.30. The statement also shows a service charge of $3.38. The balance in the check register is $1,353.55. Prepare a bank reconciliation for Madruga’s as of May 31.\r\n\r\nPeter Bell carries insurance with bodily injury limits of 25/60. Peter is in an accident and is charged with injuring four people. The judge awards damages of $10,000 to each of the injured parties. How much will the insurance company pay? How much will Peter pay?\r\n\r\nAmerican Airlines has a frequent-flier program. Coupon brokers who buy and sell these awards pay between 1 and cents for each mile earned. Fred Dietrich earned a 50,000-mile award (worth two free tickets to any city). If Fred decided to sell his award to a coupon broker, approximately how much would he receive?\r\n\r\nBack to top\r\nRent Practical Business Math Procedures 12th edition (978-1259540554) today, or search our site for other textbooks by Jeffrey Slater. Every textbook comes with a 21-day \"Any Reason\" guarantee. Published by McGraw-Hill Education.\r\n\r\nPractical Business Math Procedures 12th edition solutions are available for this textbook.\r\n\r\nNeed more help with Practical Business Math Procedures ASAP? We have you covered with 24/7 instant online tutoring. Connect with one of our tutors now.', 'Jeffrey Slater Sharon Wittry Sharon M Wittry', '1259540553', 'books/mEQO3fejwIaHS10WrcfKFNch9128999qJWCSJ3m7.jpeg', 'books/fdh1qckRPZhuGFKtFCBdLM2FrTF572hwyjimcwIi.pdf', 'books/N4ywEux1N8vT5A5VMAGSMMRCwlKSLU17QEfJoUHT.pdf', '3.5', 'انجلش', 'الخامس', 1000, 299, 'داري', '1989-11-11', 0, 1, '2018-04-19 04:46:22', '2018-06-13 07:46:11', NULL),
(37, 'Memory', 'Foundations and Applications', 'memory', 'The fully updated Third Edition of Bennett L. Schwartz’s Memory: Foundations and Applications engages students in an exploration of how memory works in everyday life through unique applications in areas such as education, job-related memory, investigations, and courtrooms. Throughout the book, integrated coverage of cognitive psychology and neuroscience connects theory and research to the areas in the brain where memory processes occur. Four overarching themes that create a framework for the text include: the active nature of learning and remembering; memory\'s status as a biological process; the multiple components of memory systems; and how memory principles can improve our individual ability to learn and remember. Featuring substantive changes that bring the book completely up to date, the Third Edition offers students an array of high-interest examples for augmenting their own memory abilities and appreciation of memory science.\r\n\r\nThe fully updated Third Edition of Bennett L. Schwartz’s Memory: Foundations and Applications engages students in an exploration of how memory works in everyday life through unique applications in areas such as education, job-related memory, investigations, and courtrooms. Throughout the book, integrated coverage of cognitive psychology and neuroscience connects theory and research to the areas in the brain where memory processes occur. Four overarching themes that create a framework for the text include: the active nature of learning and remembering; memory\'s status as a biological process; the multiple components of memory systems; and how memory principles can improve our individual ability to learn and remember. Featuring substantive changes that bring the book completely up to date, the Third Edition offers students an array of high-interest examples for augmenting their own memory abilities and appreciation of memory science.\r\n\r\nThe fully updated Third Edition of