(38, 'book', 'book', 'book', 'Filling the void left by other algorithms books, Algorithms and Data Structures provides an approach that emphasizes design techniques. The volume includes application of algorithms, examples, end-of-section exercises, end-of-chapter exercises, hints and solutions to selected exercises, figures and notes to help the reader master the design and analysis of algorithms. This volume covers data structures, searching techniques, divided-and-conquer sorting and selection, greedy algorithms, dynamic programming, text searching, computational algebra, P and NP and parallel algorithms. For those interested in a better understanding of algorithms.', 'Richard Johnsonbaugh', '0023606925', 'books/bKZMbiCJ1TOjo4aH2d139wHBVPG88dYFFI9kR1lh.jpeg', 'books/ItwcBXsnmhBiFZbumrmpRmDQ7wS7x0cGAMmG2wUd.pdf', 'books/FATStqC6ogNhKDZppETCllcZXYbosQplZ68zmT0d.pdf', '5', 'english', '2', 20, 700, '545لا افاا لابي', '2017-07-06', 1, 1, '2018-06-13 08:01:34', '2018-06-24 09:34:44', NULL),
