(87, 'ناصر الناصر النويصر', 'nasr-alnasr-alnoysr', 'لقد تأسس قسم علوم الحاسب ونظم المعلومات تحت كلية المعلمين في عام 1424هـ.\r\n وبدأ القسم منذ ذلك الحين مسيرته نحو تعليم الطلاب علوم الحاسب حتى تأسست كلية العلوم والآداب في بيشة كأحد فروع جامعة الملك خالد في منطقة عسير.\r\n\r\n وفي الثاني من جمادى الآخرة 1435 هـ الموافق 3 أبريل 2014 صدر أمر خادم الحرمين الشريفين الملك عبد الله بن عبد العزيز آل سعود رحمه الله تعالى بإنشاء جامعة بيشة، وما يزال القسم يقدم خدماته للطلاب والجامعة. وقد التحق بالقسم منذ إنشائه وحتى الآن 478 طالباً', 'saqqa4@gmail.com', '$2y$10$suYpkNC7RkSg/NTctkrFb.LpH49mhg8aNQFkHSI6j8sHuj.6v.KwK', 1, '7777777', 'images/fUFRQL3IUK5QvxNy5huzxnsosNQX1ny86bLLoAte.jpeg', 'وكيل عمادة شؤون الطلاب للشـؤون الإدارية .\r\nوكيل كلية العمارة والتخطيط.\r\nمشرف عـام إدارة المشــــاريع بالجامعة.', 'جامعه لم القرر', '2019-02-17', NULL, 0, NULL, 3, NULL, 4, NULL, NULL, 2, 'teacher', '51.211.184.14', 1, 0, 0, 0, 'https://www.youtube.com/embed/paC9paSpLt8', NULL, 1, 1, NULL, 1, 'cqJi8Cb9FOGtbOfUS0RCS3BmGkFQ0gtJJn4v5ddNwoiSWOvUst8VagVAEJD7', '2018-11-19 05:50:52', '2018-11-23 18:07:50', NULL),
