(1464, 0, 'fr', 'laravel-translation-manager::messages', 'confirm-delete', 'Êtes-vous sûr que vous voulez supprimer:\n\n:group\n\nles traductions à partir de la base de données? Toutes modifications qui n\'ont pas été publiés pour les fichiers de traduction, sera perdu.', '2018-10-25 11:42:55', '2018-10-25 11:42:55', 'Êtes-vous sûr que vous voulez supprimer:\n\n:group\n\nles traductions à partir de la base de données? Toutes modifications qui n\'ont pas été publiés pour les fichiers de traduction, sera perdu.', 0, 0, NULL, 0),
