 .</p>\r\n\r\n<p>إفشاء المعلومات</p>\r\n\r\n<p>سنحافظ في كافة الأوقات على خصوصية وسرية كافة البيانات الشخصية التي نتحصل عليها. ولن يتم إفشاء هذه المعلومات إلا إذا كان ذلك مطلوباً بموجب أي قانون أو عندما نعتقد بحسن نية أن مثل هذا الإجراء سيكون مطلوباً أو مرغوباً فيه للتمشي مع القانون , أو للدفاع عن أو حماية حقوق الملكية الخاصة بهذا الموقع أو الجهات المستفيدة منه.</p>\r\n\r\n<p>البيانات اللازمة لتنفيذ المعاملات المطلوبة من قبلك</p>\r\n\r\n<p>عندما نحتاج إلى أية بيانات خاصة بك , فإننا سنطلب منك تقديمها بمحض إرادتك. حيث ستساعدنا هذه المعلومات في الاتصال بك وتنفيذ طلباتك حيثما كان ذلك ممكنناً. لن يتم اطلاقاً بيع البيانات المقدمة من قبلك إلى أي طرف ثالث بغرض تسويقها لمصلحته الخاصة دون الحصول على موافقتك المسبقة والمكتوبة ما لم يتم ذلك على أساس أنها ضمن بيانات جماعية تستخدم للأغراض الإحصائية والأبحاث دون اشتمالها على أية بيانات من الممكن استخدامها للتعريف بك.</p>\r\n\r\n<p>عند الاتصال بنا</p>\r\n\r\n<p>سيتم التعامل مع كافة البيانات المقدمة من قبلك على أساس أنها سرية . تتطلب النماذج التي يتم تقديمها مباشرة على الشبكة تقديم البيانات التي ستساعدنا في تحسين موقعنا.سيتم استخدام البيانات التي يتم تقديمها من قبلك في الرد على كافة استفساراتك , ملاحظاتك , أو طلباتك من قبل هذا الموقع أو أيا من المواقع التابعة له .</p>\r\n\r\n<p>إفشاء المعلومات لأي طرف ثالث</p>\r\n\r\n<p>لن نقوم ببيع , المتاجرة , تأجير , أو إفشاء أية معلومات لمصلحة أي طرف ثالث خارج هذا الموقع, أو المواقع التابعة له.وسيتم الكشف عن المعلومات فقط في حالة صدور أمر بذلك من قبل أي سلطة قضائية أو تنظيمية.</p>\r\n\r\n<p>التعديلات على سياسة سرية وخصوصية المعلومات</p>\r\n\r\n<p>نحتفظ بالحق في تعديل بنود وشروط سياسة سرية وخصوصية المعلومات إن لزم الأمر ومتى كان ذلك ملائماً. سيتم تنفيذ التعديلات هنا او على صفحة سياسة الخصوصية الرئيسية وسيتم بصفة مستمرة إخطارك بالبيانات التي حصلنا عليها , وكيف سنستخدمها والجهة التي سنقوم بتزويدها بهذه البيانات.</p>\r\n\r\n<p>الاتصال بنا</p>\r\n\r\n<p>يمكنكم الاتصال بنا عند الحاجة من خلال الضغط على رابط اتصل بنا المتوفر في روابط موقعنا او الارسال الى بريدنا الالكتروني info على اسم النطاق اعلاه</p>\r\n\r\n<p>اخيرا</p>\r\n\r\n<p>إن مخاوفك واهتمامك بشأن سرية وخصوصية البيانات تعتبر مسألة في غاية الأهمية بالنسبة لنا. نحن نأمل أن يتم تحقيق ذلك من خلال هذه السياسة.</p>', NULL, '2018-02-28 09:00:36'),
(4, 'سياسة الاستخدام', 'terms', '<p>شروط الاستخدام</p>\r\n\r\n<p>بمجرّد استخدام الموقع أو مضمونه أو المعلومات التي يحويها، يُصدّق المستخدِم على أنّه قد قرأ شروط الاستخدام المفصّلة فيما يلي وأنّه يقبلها كاملة. إذا كان المستخدِم غير موافق على شروط الاستخدام هذه، فعليه أن يخرج من الموقع دون أن يستخدمه أو يستخدم المعلومات الموجودة فيه بأيّة صورة كانت.</p>\r\n\r\n<p>حقوق الملكيّة</p>\r\n\r\n<p>الموقع صاحب الملكيّة الكاملة والحصريّة لحقوق النّشر التي تخصّ الموقع ومضامينه، بما فيها النّصوص، الصّور، التّصاميم الجرافيّة والتّطبيقات البرمجيّة الموجودة في الموقع أو التي يتألّف منها الموقع (فيما يلي: المادّةالمحميّة). يُسمح للمستخدِم أن يَستخدم الموقع والمادّة المحميّة للأغراض التي خُصّصا لها فقط ولاستخدامه الفرديّ فقط. كلّ استخدام آخر، بما فيه الاستخدام لأغراض تجاريّة أيًّا كانت، محظور بصورة قطعيّة. بالإضافة إلى ما ذُكر أعلاه، يُحظر بصورة قطعيّة نسخ المادّة المحميّة (جزئيًّا أو كلّيًّا)، إرسالها (بوسائل إلكترونيّة أو غيرها)، توزيعها، نشرها، تغييرها، تحديثها وما شابه ذلك دون الحصول مسبقًا على موافقة خطّيّة صريحة من المركز.</p>\r\n\r\n<p>يُحظر نزع علامات حقوق النّشر أو علامات الملكيّة الفكريّة أو ملاحظات قضائيّة أو أيّ معلومات مُشخِّصة عن أيّ مضمون أو معلومات تمّ نسخها و/أو تمّ تحميلها من هذا الموقع. بالإضافة إلى ذلك، يُحظر التّعامل مع هذا الموقع أو أيّ جزء منه وكأنّه يحوي إذنًا صريحًا أو ضمنيًّا لاستخدام العلامات التّجارية للمركز أو لمدوّنته.</p>\r\n\r\n<p>روابط</p>\r\n\r\n<p>توجد في هذا الموقع روابط (links) توصل لمواقع أخرى، وتهدف إلى مساعدة المستخدِم. المركز ليس مسؤولاً عن مضامين تلك المواقع ولا سيطرة له عليها. يجب التّمعّن في شروط الاستخدام الخاصّة بكلّ موقع على حدة بسبب فروق ممكنة بينها وبين شروط استخدام هذا الموقع.</p>\r\n\r\n<p>مسؤوليّة</p>\r\n\r\n<p>الخدمة المعروضة في هذا الموقع معروضة للجمهور كما هي (&quot;as is&quot;). لا يتحمّل المركز مسؤوليّة ملاءمة الخدمة لأغراض المستخدم. كذلك، لا يتحمّل المركز مسؤولية أخطاء واردة في المادّة المعروضة في الخدمة. لا يتحمّل المركز مسؤوليّة تغييرات أحدَثَها المستخدِم أو أي شخص آخر في الموقع. المستخدِم وحده يتحمّل مسؤوليّة شكل استخدامه للموقع. لا يتحمّل المركز المسؤوليّة عن أيّ ضرر مباشر أو غير مباشر يحصل للمستخدِم أو لأيّ شخص آخر كنتيجة مباشرة و/أو غير مباشرة لاستخدامه الموقع، بما فيه أيّ ضرر يحصل جرّاء استخدام تطبيقات برمجيّة نُسِخَت و/أو حُـمِّلَت بواسطة الموقع أو شُغِّلَت جرّاء استخدام الموقع.</p>\r\n\r\n<p>يبذل المركز جهده في تحديث المعلومات الموجودة في الموقع لكي تكون حديثة ودقيقة. مع ذلك، لا يستطيع المركز أن يتعهّد بأن تكون معلومات الموقع مُحدَّثَة، كاملة، دقيقة وملائمة لكلّ غرض. لا يستطيع المركز أن يتعهّد بأنّ الموقع والمعلومات التي يشملها لم يتأثّرّا بصورة ما بسبب خلل تقني أو تدخّلات أو أضرار أحدثتها جهات أخرى.</p>\r\n\r\n<p>لا يستطيع المركز أن يتعهّد بأن يكون الموقع ومضامينه خاليَيْن من ڤيروسات، ديدان، أحصنة طرواديّة أو أيّ شيفرة إلكترونية أخرى تشتمل على برامج مُلوِّثة أو هدّامة. إنّ مسؤوليّة اتّخاذ خطوات وقائيّة في هذا الموضوع ملقاة بالكامل على مستخدِم الموقع، ولن يتحمّل المركز مسؤوليّة أيّ ضرر مباشر أو غير مباشر قد يحصل لمستخدِم الموقع من عوامل كهذه.</p>\r\n\r\n<p>إنّ مستخدِم هذا الموقع يأخذ على عاتقه كلّ الأخطار المنوطة باستخدام موقع إنترنت كهذا الموقع، بما فيها إمكانية أن تكون المعلومات الموجودة فيه غير كاملة، غير دقيقة، غير حديثة وما شابه ذلك، ولن يُقبل أيّ ادّعاء أو مطلب يُوجَّه للمركز بسبب ضرر مباشر أو غير مباشر حصل للمستخدِم جرّاء استخدامه الموقع. ليكن واضحًا، كما ذُكر أعلاه، أنّ المركز لن يتحمّل أيّة مسؤوليّة على أضرار حصلت لمستخدِم الموقع.</p>\r\n\r\n<p>يحقّ للمركز إضافة معلومات إلى الموقع أو إزالتها منه متى ما ارتأى ذلك ولاعتباراته الحصريّة. بالإضافة إلى ذلك، يحقّ للمركز تحديث شروط الاستخدام متى ما ارتأى ذلك ولاعتباراته الحصريّة.</p>\r\n\r\n<p>عدم ملاءمة</p>\r\n\r\n<p>في حال وجود تناقض أو عدم تطابق بين المعلومات التي ينشرها المركز وبين المعلومات المنشورة في مواقع مربوطة بروابط بهذا الموقع، فإنّ المعلومات المنشورة في تلك المواقع هي التي يُؤخذ بها.</p>', NULL, '2018-02-28 09:00:08'),
